import React from "react";

const CertificateTemplate = ({ certificate }) => {
  return (
    <div>
      <h1>Certificate of Completion</h1>
      <p>
        This is to certify that {certificate.studentName} has completed the
        internship program in {certificate.internshipDomain} from{" "}
        {certificate.startDate} to {certificate.endDate}.
      </p>
      <p>Issued by: [Your Organization Name]</p>
    </div>
  );
};

export default CertificateTemplate;
